import React from 'react';
import './UserItem.css';

const UserItem = props=>{
    return (
        <li className="user-item">
            <div className="user-item_content">
                <div className="user-item_image">
                    <img src={props.image} alt={props.name}/>
                </div>
            </div>
        </li>
    )
}

export default UserItem;
